import algorithms.LongestSubsequence
import org.junit.jupiter.api.AfterEach
import org.junit.jupiter.api.BeforeEach
import org.junit.jupiter.api.DisplayName
import org.junit.jupiter.api.Test
import kotlin.collections.set
import kotlin.test.assertEquals

/**
 * rosalind:
 * http://rosalind.info/problems/lgis/
 * Longest Increasing Subsequence (and Decreasing)
 */
/**
 * Problem

A subsequence of a permutation is a collection of elements of the permutation
in the order that they appear. For example, (5, 3, 4) is a subsequence of (5, 1, 3, 4, 2).

A subsequence is increasing if the elements of the subsequence increase,
and decreasing if the elements decrease. For example, given the permutation
(8, 2, 1, 6, 5, 7, 4, 3, 9), an increasing subsequence is (2, 6, 7, 9),
and a decreasing subsequence is (8, 6, 5, 4, 3). You may verify that
these two subsequences are as long as possible.

Given: A positive integer n≤10000 followed by a permutation π of length n

Return: A longest increasing subsequence of π, followed by a longest decreasing
subsequence of π.
 */

internal class RosieLongestSubsequenceTest {

    lateinit var ls : LongestSubsequence

    @BeforeEach
    fun setUp() {
        ls = LongestSubsequence()
    }

    @AfterEach
    fun tearDown() {
    }

    @DisplayName("Rosalind Longest Subsequence sample test")
    @Test
    fun rosalindLongestSubsequenceSampleTest() {
        val input = """
            5
            5 1 4 2 3
        """.trimIndent().lines()

        val sequence = input[1].split(" ").map {it.toInt()}

        // 5 4 2  (original answer)
        val expectedResult = """
            1 2 3
            5 4 3
        """.trimIndent().lines()

        val expectedIncreasing = expectedResult[0].split(" ").map {it.toInt()}
        val expectedDecreasing = expectedResult[1].split(" ").map {it.toInt()}

        val result = ls.longestSequences(sequence)

        assertEquals(expectedIncreasing, result[0])
        assertEquals(expectedDecreasing, result[1])
    }

    @DisplayName("Rosalind Longest Subsequence contrived1 test")
    @Test
    fun rosalindLongestSubsequenceContrivedTest() {
        val input = """
20
6 4 2 3 8 1 7 10 9 20 18 19 16 17 14 15 12 13 11 5
        """.trimIndent().lines()

        val sequence = input[1].split(" ").map {it.toInt()}

        val expectedResult = """
2 3 7 9 12 13
20 19 17 15 13 11 5
        """.trimIndent().lines()

        val expectedIncreasing = expectedResult[0].split(" ").map {it.toInt()}
        val expectedDecreasing = expectedResult[1].split(" ").map {it.toInt()}

        val result = ls.longestSequences(sequence)

        assertEquals(expectedIncreasing, result[0])
        assertEquals(expectedDecreasing, result[1])

//        println(result[0].joinToString(" "))
//        println(result[1].joinToString(" "))
    }

